import React, { Component } from 'react';



class Navbar extends Component {



	render(){


		return(
			<nav class="navbar navbar-light bg-light">
				<span class="navbar-text">
					Hi! Sign in or Reigster
				</span>
				<span class="navbar-text">
					Daily Deals
				</span>
				<span class="navbar-text">
					Sell
				</span>
				<span class="navbar-text">
					Help & Contact
				</span>
				<span class="navbar-text">
					GBP
				</span>
				<span class="navbar-text">
					Your Bag 3.99
				</span>

			</nav>
		);
	}
}





export default Navbar;
